import { React, useEffect } from "react";

export const Nav = () => {
  const fetctData = async () => {
    const data = await (await fetch("http://localhost:5000/meal")).json();

    console.log("");
    console.log(data);
  };

  useEffect(() => {
    fetctData();
  }, []);
  return <div></div>;
};
